VALUES
( 1, '2022-01-01', 'Totally real title', 'So what really is fan fiction? It`s when amateur authors write their own story based on an already-existing book, movie, TV show, etc. The stories will use the same characters, but they don`t always take place in the same setting or in the same time period. In some stories, the only way to tell it`s based on another piece of fiction is that the characters have the same name; everything else is completely different. Most fan fiction lives on FanFiction.net, but it can also be found on Wattpad, FicSisters, A Different Forest,but it can also be found on Wattpad, FicSisters, A Different Forest, and Tumblr, among other places. No matter where it is, Twilight fan fiction runs the gamut from all-human stories to the original vampire/werewolf storyline.' , FALSE),
